import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import GlobalStyle from "./GlobalStyle";
import Home from "./Home";


function App() {
  return (
      <Router>
        <GlobalStyle />
        <Routes>
          <Route path="/" exact element={<Home/>} />
        </Routes>
      </Router>
  );
}

export default App;
